import { Container, Row, Col, Carousel, Card, Button } from 'react-bootstrap';

export const Blog = () => {
    return (
        <section className='blog'>
            <div className='container grid3'>
                {Blog.map((item) =>  (
                    <div className='box boxItems' key={item.id}>
                        <div className='img'>
                            <img src={item.cover} alt=''/>
                        </div>

                    </div>
                ))}
            </div>
        </section>    
    );
};

export default Blog;
